import React, { useState } from 'react';

interface ABTestFormData {
  controlImpressions: number;
  controlClicks: number;
  variantImpressions: number;
  variantClicks: number;
}

const ABTestCreator: React.FC = () => {
  const [formData, setFormData] = useState<ABTestFormData>({
    controlImpressions: 0,
    controlClicks: 0,
    variantImpressions: 0,
    variantClicks: 0,
  });

  const handleInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = event.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: parseInt(value, 10),
    }));
  };

  const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();
    // Make the API call to create the AB test using the form data
    console.log('Form data:', formData);
  };

  return (
  <div className="container">
      <h2 className="heading">
        <img src={icon} alt="Icon" className="icon" /> WinTests - AB Testing
      </h2> {/* Heading with the icon */}
        <form className="form" onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="controlImpressions">Control Impressions</label>
          <input
            type="number"
            id="controlImpressions"
            name="controlImpressions"
            value={formData.controlImpressions}
            onChange={handleInputChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="controlClicks">Control Clicks</label>
          <input
            type="number"
            id="controlClicks"
            name="controlClicks"
            value={formData.controlClicks}
            onChange={handleInputChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="variantImpressions">Variant Impressions</label>
          <input
            type="number"
            id="variantImpressions"
            name="variantImpressions"
            value={formData.variantImpressions}
            onChange={handleInputChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="variantClicks">Variant Clicks</label>
          <input
            type="number"
            id="variantClicks"
            name="variantClicks"
            value={formData.variantClicks}
            onChange={handleInputChange}
          />
        </div>
        <button type="submit" className="submit-btn">
          Create
        </button>
      </form>
    </div>
  );
};

export default ABTestCreator;
